import react from 'react';
import Cls from './sample';
import  ReactDOM  from 'react';

function App(Props) {
  return (
    <div>
      <p> chocolate brand:{Props.Brand}</p>
      <Cls/>
    </div>
  );
}
const choci=<App Brand='Cadbury'/>
ReactDOM.render( choci,document.getElementById('root'));

export default App;
